import React from "react";
import QuoteList from "../components/quotes/QuoteList";

const AllQuotes = () => {
  const dummy_quotes = [
    { id: "q1", author: "kareem", text: "iam learning reactjs" },
    { id: "q2", author: "kemetitch", text: "iam playing football" },
  ];
  return (
    <div>
      <QuoteList quotes={dummy_quotes} />
    </div>
  );
};
export default AllQuotes;
